import * as React from "react";
import AddAlertIcon from '@mui/icons-material/AddAlert';
import AppBar from "@mui/material/AppBar";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import HomeIcon from "@mui/icons-material/Home";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import PillIcon from "./PillIcon.js"

export default function MenuAppBar() {
    // Styles and SX
    const boxSx = {
        flexGrow: 1
    };

    const buttonSx = {
        fontSize: 21,
        mr: 1
    };

    const iconButtonSx = {
        mr: 1
    }

    return (
        <Box sx={boxSx}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        aria-label="menu"
                        color="inherit"
                        component="a"
                        href="/main-menu"
                        size="large"
                    >
                        <HomeIcon/>
                    </IconButton>
                    <IconButton
                        aria-label="medications"
                        color="inherit"
                        href="/"
                        size="large"
                        sx={iconButtonSx}
                    >
                        <PillIcon/>
                    </IconButton>
                    <IconButton
                        aria-label="menu"
                        color="inherit"
                        component="a"
                        href="/main-menu"
                        size="large"
                    >
                        <AddAlertIcon />
                    </IconButton>

                    <Box sx={boxSx}/>

                    <Button color="inherit" sx={buttonSx} size="large">LOGOUT</Button>
                </Toolbar>
            </AppBar>
        </Box>
    );
}
